import React, { Component } from 'react';
import ReactDom from 'react-dom';
import { Carousel, Item, Caption, Card, Col, Figure } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.css';
import Tata_safari from './vehicles/tata_safari.jpeg';
import Jeeto from './vehicles/mahindra_jeeto.jpeg';
import Scorpio from './vehicles/mahindra_scorpio.jpeg';
import '../node_modules/bootstrap/dist/css/bootstrap.min.css'
import './coursel.css'



export default function Cour_dynamic(prop) {
alert(typeof(prop.name));


const obj1 = eval( prop.name );
alert(obj1);

    const all_vehicles = [{ "Vehicle": "Jeeto" }, { "Vehicle": "Tata_safari" }, { "Vehicle": "Scorpio" }]
    return (<div>
        <Carousel >
            <Carousel.Item className="coursize">
                <img
                    className="imgsize"
                    src={Jeeto}

                    alt="First slide"

                />
                <Carousel.Caption>

                    <p>Jeeto</p>
                </Carousel.Caption>
            </Carousel.Item>
            <Carousel.Item className="coursize">
                <img
                    className="imgsize"
                    src={Scorpio}
                    alt="Third slide"
                    style={{ height: '100%', width: '100%' }}
                />

                <Carousel.Caption>
                    <h3>Second slide label</h3>
                    <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
                </Carousel.Caption>
            </Carousel.Item>

        </Carousel>

</div>


    )

}
